create database exam;

create EXTENSION "uuid-ossp";

create type event_type as enum('online', 'offline');
create type status as enum('pending', 'confired', 'canceled');


drop table users;
create table users(
    user_id uuid default uuid_generate_v4() primary key,
    username varchar(30) not null,
    password varchar(100) not null
);


drop table categories;
create table categories(
    category_id uuid default uuid_generate_v4() primary key,
    category_name varchar(50) not null
);


drop table sub_categories;
create table sub_categories(
    sub_category_id uuid default uuid_generate_v4() primary key,
    category_id uuid references categories(category_id) ON DELETE CASCADE not null,
    sub_category_name varchar(50) not null
);


drop table posts;
create table posts(
    post_id uuid default uuid_generate_v4() primary key,
    post_title text not null,
    post_img text not null,
    post_desc text not null,
    post_text text not null,
    post_date timestamp not null,
    post_time time not null,
    fullname varchar(50) not null,
    profession varchar(50) not null,
    phone_num text not null,
    additional_phone_num text not null,
    post_status status default 'pending',
    post_category uuid references categories(category_id) ON DELETE CASCADE not null,
    post_subcategory uuid references sub_categories(sub_category_id) ON DELETE CASCADE not null,
    post_type event_type not null,
    post_link text check (post_link ~ '^((ftp|http|https):\/\/)?(www\.)?([A-Za-zА-Яа-я0-9]{1}[A-Za-zА-Яа-я0-9\-]*\.?)*\.{1}[A-Za-zА-Яа-я0-9-]{2,8}(\/([\w#!:.?+=&%@!\-\/])*)?') not null
);


drop table comments;
create table comments(
    comment_id uuid default uuid_generate_v4(),
    user_id uuid references users(user_id) ON DELETE CASCADE not null,
    post_id uuid references posts(post_id) ON DELETE CASCADE not null,
    comment_body text not null
);






